import React from 'react';
import './css/nav_component.scss';
import { Link } from 'react-router-dom';
import Master from '../Master/Master';

function NavComponent(props) {
    let textClass = props.theme == 'dark' ? 'nav_text_dark' : 'nav_text_light';
    const { slug } = Master.navigation;
    return (
        <div className="nav_links_div">
            <ul className={`${textClass}`}>
                <li><Link className={slug === "page-two" ? "selected" : null}
            to="/page-two">Portfolio</Link></li>
                <li><Link  to="/page-two" >Solutions</Link></li>
                <li><Link  to="/page-three" >Our Agency</Link></li>
                <li><a href="#">Contact Us</a></li>
            </ul>
        </div>
    );
}

export default NavComponent;
